package com.bzkj.dto.activity;import java.io.Serializable;/** * @description: 奖品信息 * @author: jensen * @date: created by 2019/8/28 19:48 */public class GoodsList implements Serializable {    private int psOrder;    private String activityId;    private String rightName;    private String rightId;    private String rightPicUrl;    public GoodsList(int psOrder, String activityId, String rightName, String rightId, String rightPicUrl) {        this.psOrder = psOrder;        this.activityId = activityId;        this.rightName = rightName;        this.rightId = rightId;        this.rightPicUrl = rightPicUrl;    }    public int getPsOrder() {        return psOrder;    }    public void setPsOrder(int psOrder) {        this.psOrder = psOrder;    }    public String getActivityId() {        return activityId;    }    public void setActivityId(String activityId) {        this.activityId = activityId;    }    public String getRightId() {        return rightId;    }    public void setRightId(String rightId) {        this.rightId = rightId;    }	public String getRightName() {		return rightName;	}	public void setRightName(String rightName) {		this.rightName = rightName;	}	public String getRightPicUrl() {		return rightPicUrl;	}	public void setRightPicUrl(String rightPicUrl) {		this.rightPicUrl = rightPicUrl;	}}